0.ds_documentacao:
Documentos necessários a todos os candidatos classificados para chamadas das vagas universais e vagas reservadas:
a) Documento de conclusão do Ensino Médio ou equivalente (Diploma/Certificado de Conclusão do Ensino Médio ou
Certificado de Conclusão do EJA ou Certificado de Conclusão de Educação Profissional de Nível Técnico ou
equivalente). O candidato que não apresentar esse documento não realizará a matrícula;
b) Histórico Escolar do Ensino Médio;
c) Certidão de Nascimento ou Casamento;
d) Documento de Identidade. No caso de candidato estrangeiro, apresentar a cópia do Registro Nacional de
Estrangeiro;
e) Cartão do Cadastro de Pessoa Física (CPF);
f) Certificado de Reservista ou prova de que está em dia com as obrigações militares (para o candidato do sexo
masculino e com mais de 18 anos);
g) Título Eleitoral (obrigatório para o candidato com, no mínimo 18 anos e facultativo para o candidato com 16 ou 17
anos);
h) Certidão de Quitação Eleitoral (obrigatório para o candidato com, no mínimo 18 anos e facultativo para o
candidato com 16 ou 17 anos); e,
i) Uma fotografia 5x7cm frontal e com data (2018 ou 2019).

Documentação específica para  candidatos classificados para chamadas das vagas reservadas disponíveis em:
https://cs.ufgd.edu.br/download/EDITAL_PROGRAD_N.52_SISU2020.pdf 
https://cs.ufgd.edu.br/download/Documentos_analise_de_renda_SISU2020.pdf

